import React, { useState, useEffect } from "react";
import { StyleSheet, Text, View } from "react-native";
import { NavigationContainer } from "@react-navigation/native";
import { createStackNavigator } from "@react-navigation/stack";
import { createBottomTabNavigator } from "@react-navigation/bottom-tabs";
import { AsyncStorage } from "react-native";

const Stack = createStackNavigator();

import { LoginScreen } from "./components/LoginScreen";
import { SignInScreen } from "./components/SignInScreen";
import { HomeScreen } from "./components/HomeScreen";

export default function App() {
  const [isLoading, setIsLoading] = useState(true);
  const [logged, setLogged] = useState(false);

  async function checkUserAlreadyLogged() {
    try {
      const userAlreadyLogged = await AsyncStorage.getItem("logged");
      if (!!userAlreadyLogged) {
        setLogged(true);
      }
      setIsLoading(false);
    } catch (e) {
      console.log(e);
    }
  }

  useEffect(() => {
    checkUserAlreadyLogged();
    console.log(logged);
  });

  return (
    <NavigationContainer>
      <Stack.Navigator>
        {logged === false ? (
          <Stack.Screen name="Login">
            {props => <LoginScreen {...props} setLogged={setLogged} />}
          </Stack.Screen>
        ) : (
<HomeStackScreen setLogged={setLogged} />
        )}
      </Stack.Navigator>
    </NavigationContainer>
  );
}

const HomeStack = createStackNavigator();

function HomeStackScreen({setlogged}) {
  return (
<HomeStack.Navigator>
          <Stack.Screen name="Home">
            {props => <HomeScreen {...props} setLogged={setLogged} />}
          </Stack.Screen>
</HomeStack.Navigator>
      )
}
